Kabouter Plop is naar het Koninklijk paleis vertrokken om zijn plopkoeken aan te bieden aan de koning. Hij probeert zo de hofleverancier te worden. Op weg naar het paleis krijgt Plop gezelschap van Klus, die een bezoek aan het paleis voor geen goud wil missen. Aangekomen bij het paleis blijkt dat de koning er niet meer is. De kabouters wachten op de komst van de nieuwe koning, een kabouterprins. Ze zien Plop per ongeluk aan voor de troonopvolger. Voordat hij het goed en wel beseft, zit Plop op de troon als de nieuwe koning. Klus vindt het allemaal geweldig. Zeker wanneer hij samen met Kwebbel en Lui zijn intrek mag nemen in het paleis en ze bediend worden door lakeien. Maar Plop maakt zich zorgen. Want waar is de echte kabouterprins gebleven?



